/*
** noc_category **
category_id,
lang_id,
category_name

** noc_sub_category **
sub_category_id,
category_id,
lang_id,
sub_category_name

** noc_occupation **
occupation_id,
sub_category_id,
lang_id,
occupation_name,
occupation_description, [text]
occupation_example_titles, [text]
occupation_duties, [text]
occupation_employment_requirements [text]

** noc_occupation_relations **
occupation_id,
related_occupation_id,
occupation_relation_title

*/

DROP TABLE IF EXISTS `company_prospects_noc`;
CREATE TABLE `company_prospects_noc` (
    `noc_code` VARCHAR(4) NULL,
    `noc_admissible` VARCHAR(20) NULL,
    `noc_title` VARCHAR(255) NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `company_prospects_noc_job_titles`;
CREATE TABLE IF NOT EXISTS `company_prospects_noc_job_titles` (
  `noc_code` varchar(4) default NULL,
  `noc_job_title` varchar(255) default NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

